import http from "./httpService";

export async function searchUser(user_handler) {
  const users = await http.get(
    `http://localhost:3900//search/user/${user_handler}`
  );
  return rankUsers(users);
}

function rankUsers(users) {
  return users
    .sort((u1, u2) => u2.followers_count - u1.followers_count)
    .map((u) => u.screen_name);
}

module.exports = searchUser;
